import React  from 'react';
import  Header from  "./Header";
import  Footer from  "./Footer";
import CreateNote from "./CreateNote";
import  Notes from  "./Notes";
import './index';

const App =()=>{
    return ( 
    <>
        <Header/>
        <Footer/>
        <CreateNote/>
        <Notes/>
    </>
    )
}

export default App;
